import { BsYoutube, BsInstagram } from 'react-icons/bs';
import { Link } from 'react-router-dom';

import './menu.css';

function Menu() {
    return (
        <div className="menu">
            <a className="social" href="https://instagram.com/pbenderson"></a>
            <BsInstagram size={24} color="#fff" />
        </div>
    );
}

export default Menu;
